import React from 'react'

import PostListItem from '../post-list-item/post-list-item';

const PostList = ({posts}) => {

    const element = posts.map((item)=>{
        return (
            <li className='list'>
                <PostListItem 
                    label={item.label}
                    important={item.important}
                />
            </li>
        )
    });

    return (
        <ul>
            {element}
        </ul>
    )
}

export default PostList
